  },

  2: {
    name: 'Fabric',
    icon: base_url + "fabric-icon.png"
  },

  3: {
    name: 'Ethereum',
    icon: base_url + "ethereum.png"
  },
  5: {
    name: 'Credits',
    icon: base_url + "credits_icon.png"
  },
  6:{
    name:"Corda",
    icon:base_url + 'corda-logo.png'
  },

  7:{
    name:"Fluree",
    icon:base_url + 'fluree-header-icon.png'
  }

}
